import React, { useContext, useState, useEffect } from "react";
import { useNavigation } from "@react-navigation/native";
import { BackgroundLinear } from "./gradient";
import ButtonComponent from "../../components/button";
import Icon from "react-native-vector-icons/FontAwesome";
import Icon2 from "react-native-vector-icons/MaterialCommunityIcons";
import {
  Container,
  TextComponet,
  TabBottom,
  ImageComponetBotton,
  ContentBotton,
  ImageComponet,
  TitleComponet,
  TextServices,
  Services,
  ButtonServices,
  TextButtonServices,
  ButtonHandle,
  Content,
  Button,
} from "./styles";
import { AuthContex } from "../../contexts/auth";

const Home = () => {
  const navigation = useNavigation();

  const { handleServices } = useContext(AuthContex);
  const [corte, setCorte] = useState(false);
  const [limpeza, setLimpeza] = useState(false);
  const [sombrancelha, setSombrancelha] = useState(false);
  const [barba, setBarba] = useState(false);
  const [services, setServices] = useState({
    corte: false,
    limpeza: false,
    sombrancelha: false,
    barba: false,
  });

  useEffect(() => {
  }, [corte, limpeza, sombrancelha, barba]);

  const handleSubmit = () => {
    handleServices(services);
    navigation.navigate("Schedule");
  };
  return (
    <BackgroundLinear>
      <Container>
        <TitleComponet>Home</TitleComponet>
      
          <Button  onPress={() => navigation.navigate("Login")}>
          Voltar
          </Button>
        <TabBottom>
          <ContentBotton>
            <ImageComponetBotton source={require("../../assets/agenda.png")} />
          </ContentBotton>
          <Button  onPress={() => navigation.navigate("List")}>
            <Icon name="list" size={30} color="#fff" />
          </Button>
        </TabBottom>
      </Container>
    </BackgroundLinear>
  );
};

export default Home;
